import React from "react";
import WithLabelExample from "./ProgressBar ";
import {} from "../img/Carouselstyle.css";

const Testimotial = () => {
  return (
    <>
      <div className="Containerprogress">
        <div className="ProgressBar">
          <div className="htmlprogress">
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/640px-HTML5_logo_and_wordmark.svg.png"
              alt="images1"
              style={{ width: "20%", height: "20%" }}
            />
              <p>Lorem ipsum dolor sit amet, consectetur</p>
              <WithLabelExample />
              <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/640px-HTML5_logo_and_wordmark.svg.png"
              alt="images1"
              style={{ width: "20%", height: "20%" }}
            />
              <p>Lorem ipsum dolor sit amet, consectetur</p>
              <WithLabelExample />
              <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/640px-HTML5_logo_and_wordmark.svg.png"
              alt="images1"
              style={{ width: "20%", height: "20%" }}
            />
              <p>Lorem ipsum dolor sit amet, consectetur</p>
              <WithLabelExample />
              <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/640px-HTML5_logo_and_wordmark.svg.png"
              alt="images1"
              style={{ width: "20%", height: "20%" }}
            />
              <p>Lorem ipsum dolor sit amet, consectetur</p>
              <WithLabelExample />
              
          </div>
          
        </div>
      </div>
    </>
  );
};

export default Testimotial;
